import React from "react";
import Editor from "./Editor";
import Console from "./Console";
import Tabs from "./Tabs"

function IDE() {

    return (
        <div className="grid grid-cols-2 my-4">
            <div className="mx-2 flex justify-center">
                <div className="block">
                    <Tabs />
                    <Editor /> 
                </div>
                
            </div>

            <div className="mx-2">
                <Console />
            </div>
            
        </div>
    )
}


export default IDE;
